import {Route} from 'react-router-dom';

import Welcome from "./pages/Welcome";
import Product from './pages/Product';

function App() {
  return (
    <div>
      <header></header>
      <main>
        <Route path="/welcome">
          <Welcome />
        </Route>
        <Route path="/product">
          <Product />
        </Route>
      </main>
    </div>
  );
}

export default App;
